        [HttpPost("pass/cardNumber/{cardNumber}/wallet/delete")]
        public IActionResult Delete(string cardNumber)
        {
            try
            {
                SqlCommand command = new SqlCommand();
                command.CommandText = "API_OptionsWallet"; // Set the stored procedure name
                command.CommandType = CommandType.StoredProcedure; // Set the command type to Stored Procedure
                command.Parameters.AddWithValue("@cardNumber", cardNumber);
                command.Parameters.AddWithValue("@metodo", 1);
                DataTable dt = _DB.ExecuteCommand(command).Tables[0];
                string WalletExist = dt.Rows[0][0].ToString();
                if (WalletExist == "1")
                {
                    return Ok("Wallet deleted succesfully");
                }
                else
                {
                    return this.NotFound("Wallet not found");
                }

            }
            catch (Exception ex)
            {
                return BadRequest(ex.Message);
            }
        }

