        public static byte[] ReadFileBytes(string nameFile)
        {
            try
            {
                using (HttpClient client = new HttpClient())
                {
                    // Construir la URL completa para la API que devuelve los bytes del archivo
                    string apiUrl = "http://localhost:49915/byteFile/nameFile/" + nameFile + "/get";

                    // Realizar la solicitud HTTP para obtener los bytes del archivo
                    HttpResponseMessage response = client.GetAsync(apiUrl).Result;

                    // Verificar si la solicitud fue exitosa
                    if (response.IsSuccessStatusCode)
                    {
                        // Leer y devolver los bytes del contenido de la respuesta
                        return response.Content.ReadAsByteArrayAsync().Result;
                    }
                    else
                    {
                        // Manejar el caso en que la solicitud no fue exitosa
                        Console.WriteLine($"Error al obtener el archivo {nameFile}. Código de estado: {response.StatusCode}");
                        return null; // o lanzar una excepción, según lo que prefieras
                    }
                }
            }
            catch (Exception ex)
            {
                // Manejar cualquier excepción que pueda ocurrir durante la lectura del archivo
                Console.WriteLine($"Error al leer el archivo {nameFile}: {ex.Message}");
                return null; // o lanzar una excepción, según lo que prefieras
            }
        }

        public static string FileStreamGenerate(string programId, string FileName)
        {
            try
            {
                // Construir la URL completa para la API que verifica y crea el directorio
                string apiUrl = "http://localhost:49915/FileStreamGenerate/programId/" + programId + "/FileName/" + FileName + "/post";
                HttpClient client = new HttpClient();
                // Realizar la solicitud HTTP para verificar y crear el directorio
                HttpResponseMessage response = client.PostAsync(apiUrl, null).Result;

                // Verificar si la solicitud fue exitosa
                if (response.IsSuccessStatusCode)
                {
                    // Leer el flujo de respuesta y devolverlo
                    return "1";
                }
                else
                {
                    // Manejar el caso en que la solicitud no fue exitosa
                    Console.WriteLine($"Error al verificar o crear directorio. Código de estado: {response.StatusCode}");
                    // Puedes lanzar una excepción si lo prefieres
                    return "Error al verificar o crear directorio";

                }
            }
            catch (Exception ex)
            {
                // Manejar cualquier excepción que pueda ocurrir durante la solicitud HTTP
                Console.WriteLine($"Error: {ex.Message}");
                // Puedes lanzar una excepción si lo prefieres
                return "Error al verificar o crear directorio, " + ex.Message;
            }
        }


